import './works.scss';

const Works = () => {
  return (
    <>
      <div className="works" id="works">
        <div className="slider">
          <div className="container">
            <div className="item">
              <div className="left"></div>
              <div className="right"></div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Works;
